INSERT INTO `lowongan_pekerjaan` (`id_loker`, `Nama`, `waktu_mulai`, `waktu_akhir`, `kualifikasi`, `jobdesk`) VALUES
('JOB0001', 'CASHIER', '2023-12-08', '2023-12-21', '- Berpenampilan menarik\r\n- Berkomunikasi dengan baik dan cakap\r\n- Berkepribadian baik, jujur, amanah dan tangguh\r\n- Mampu dan teliti dalam hitung-menghitung\r\n- Bekerja secara team dan sanggup bekerja shift  \r\n- Mempunyai minat tinggi di posisi pengkasiran\r\n\r\nRange Salary (Kisaran Gaji) Rp 1.5xx.xxx - Rp 2.xxx.xxx\r\n*range berdasarkan pengalaman kerja', 'Bertanggung jawab untuk menerima dan mencatat setiap transaksi penjualan baik cash, credit & debit serta pembayaran dana elektronik. Memahami sistem billing dan pengoperasian sistem pembayaran EDC dan lainnya. Memiliki pengetahuan dasar tentang hospitality (pelayanan).'),
('JOB0002', 'BARISTA', '2023-12-08', '2024-01-07', '- Berpenampilan menarik\r\n- Berkomunikasi dengan baik dan cakap\r\n- Modis, mempunyai ketertarikan dengan bidang pelayanan\r\n- Berkepribadian ramah, kreatif dan berinisiatif tinggi\r\n- Bekerja secara team dan sanggup bekerja shift \r\n- Mengerti tentang minuman kopi dan proses pembuatannya\r\n- Mengerti pengoperasian mesin kopi dan perawatannya\r\n- Mempunyai minat tinggi di bidang barista\r\n\r\nRange Salary (Kisaran Gaji)\r\n- Fresh Graduates/ Non Experience Rp 1.2xx.xxx\r\n- Experience up to 2 years Rp 1.5xx.xxx - Rp 2.xxx.xxx\r\n', 'Bertanggung jawab untuk memberikan pelayanan terbaik dan menyajikan produk sesuai dengan standar kualitas yang diterapkan kepada pelanggan dengan sigap dan cekatan. Barista menguasai pengetahuan mendasar akan kopi dan industrinya, serta pengetahuan dasar tentang hospitality (pelayanan).'),
('JOB0003', 'COOK & COOK HELPER', '2024-05-08', '2024-05-23', '- Berkomunikasi dengan baik dan cakap\r\n- Paham akan bahan baku dan harga pasar dengan baik\r\n- Menguasai standar kebersihan bahan makan, alat masak dan ruang dapur, paham akan cooking method\r\n- Mengerti dan mempunyai referensi jenis masakan nusantara dan western\r\n- Mempunyai minat di bidang masak-memasak\r\n- Sanggup bekerja shift dan mengikuti pelatihan\r\n\r\nRange Salary (Kisaran Gaji)\r\n- Pengalaman minimal 1 tahun COOK HELPER Rp 1.5xx.xxx - Rp 2.xxx.xxx\r\n- Pengalaman minimal 1-2 tahun COOK Rp 2.xxx.xxx - Rp 2.8xx.xxx', 'Bertanggung jawab untuk membantu Head Cook dalam pengelolaan dapur, menjaga standarisasi menu produksi baik cita rasa maupun penyajiannya, turut membantu Head Cook dalam menyeimbangkan biaya produksi dan strategi penjualan produk makanan.'),
('JOB0004', 'COOK & COOK HELPER', '2024-02-29', '2024-03-05', '\r\n- Berkomunikasi dengan baik dan cakap\r\n- Menguasai standar kebersihan bahan makan, alat masak dan ruang dapur, paham akan cooking method\r\n- Mengerti dan mempunyai referensi jenis masakan nusantara dan western\r\n- Mempunyai minat di bidang masak-memasak\r\n- Libur 1 minggu 1x\r\n- Mengikuti shift 16.00 - 22.30 ', 'DAILY WORKER\r\n\r\nBertanggung jawab untuk membantu Head Cook dalam pengelolaan dapur, menjaga standarisasi menu produksi baik cita rasa maupun penyajiannya, turut membantu Head Cook dalam menyeimbangkan biaya produksi dan strategi penjualan produk makanan.\r\n'),
('JOB0005', 'BARISTA', '2024-02-29', '2024-03-05', '- Berpenampilan menarik\r\n- Berkomunikasi dengan baik dan cakap\r\n- Modis, mempunyai ketertarikan dengan bidang pelayanan\r\n- Berkepribadian ramah, kreatif dan berinisiatif tinggi\r\n- Bekerja secara team\r\n- Mengerti tentang minuman kopi dan proses pembuatannya\r\n- Mengerti pengoperasian mesin kopi dan perawatannya\r\n- Mempunyai minat tinggi di bidang barista\r\n', 'DAILY WORKER / PART-TIME\r\n\r\nBertanggung jawab untuk memberikan pelayanan terbaik dan menyajikan produk sesuai dengan standar kualitas yang diterapkan kepada pelanggan dengan sigap dan cekatan. Barista menguasai pengetahuan mendasar akan kopi dan industrinya, serta pengetahuan dasar tentang hospitality (pelayanan).\r\n\r\n'),
('JOB0006', 'BARISTA', '2024-06-25', '2024-07-06', '- Minimal usia 17 Tahun dan memiliki KTP (Kartu Identitas/Keterangan Identitas lainnya) \r\n- Berpenampilan menarik\r\n- Berkomunikasi dengan baik dan cakap\r\n- Modis, mempunyai ketertarikan dengan bidang pelayanan\r\n- Berkepribadian ramah, kreatif dan berinisiatif tinggi\r\n- Bekerja secara team dan sanggup bekerja shift \r\n- Mempunyai minat tinggi terhadap Kopi dan pekerjaan di bidang barista\r\n', 'Bertanggung jawab untuk memberikan pelayanan terbaik dan menyajikan produk sesuai dengan standar kualitas yang diterapkan kepada pelanggan dengan sigap dan cekatan. Barista menguasai pengetahuan mendasar akan kopi dan industrinya, serta pengetahuan dasar tentang hospitality (pelayanan).\r\n'),
('JOB0007', 'COOK & COOK HELPER', '2024-06-25', '2024-07-06', '- Berkomunikasi dengan baik dan cakap\r\n- Paham akan bahan baku dan harga pasar dengan baik\r\n- Menguasai standar kebersihan bahan makan, alat masak dan ruang dapur, paham akan cooking method\r\n- Mengerti dan mempunyai referensi jenis masakan nusantara dan western\r\n- Mempunyai minat di bidang masak-memasak\r\n- Sanggup bekerja shift dan mengikuti pelatihan\r\n\r\nRange Salary (Kisaran Gaji)\r\n- Pengalaman minimal 1 tahun COOK HELPER Rp 1.5xx.xxx - Rp 2.xxx.xxx\r\n- Pengalaman minimal 1-2 tahun COOK Rp 2.xxx.xxx - Rp 2.8xx.xxx\r\n', 'Bertanggung jawab untuk membantu Head Cook dalam pengelolaan dapur, menjaga standarisasi menu produksi baik cita rasa maupun penyajiannya, turut membantu Head Cook dalam menyeimbangkan biaya produksi dan strategi penjualan produk makanan.\r\n');
